import React, { useEffect, useState } from 'react';
import { useParams } from 'react-router-dom';
import { fetchDiagnosisResults } from '../utils/api';

function DiagnosisResults() {
  const { submissionId } = useParams(); // Use submissionId dynamically from the route
  const [results, setResults] = useState([]);
  const [error, setError] = useState('');

  useEffect(() => {
    async function loadResults() {
      try {
        const data = await fetchDiagnosisResults(submissionId);
        setResults(data);
      } catch (err) {
        console.error('Error fetching diagnosis results:', err);
        setError('Failed to load diagnosis results. Please try again.');
      }
    }
    loadResults();
  }, [submissionId]);

  if (error) {
    return <p className="error-message">{error}</p>;
  }

  if (!results.length) {
    return <p>Loading diagnosis results...</p>;
  }

  return (
    <div className="diagnosis-results">
      <h2>Diagnosis Results for Submission ID: {submissionId}</h2>
      <ul>
        {results.map((result) => (
          <li key={result.id}>
            <strong>{result.organ_name}</strong>: {result.diagnosis_name} <br />
            <em>{result.description}</em>
          </li>
        ))}
      </ul>
    </div>
  );
}

export default DiagnosisResults;
